import axios from "axios";

const getData = async (token, setToken, employees, setEmployees) => {
  try {
    await axios
      .post("http://cms.avertra.com/auth/local", {
        identifier: "Cms@avertra.com",
        password: "Avertra@2021",
      })
      .then((response) => {
        console.log(response.data, "Data");
        setToken(response.data.jwt);
      });
  } catch (err) {
    // Handle Error Here
    console.error(err);
  }
};

export { getData };
